import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import Notes from "./Notes"; 

const App = () => {
  return (
    <div>
      <Header />
      {Notes.map((noteitem)=>{
        <Note />
      })}
      <Footer />
    </div>
  );
};

export default App;
